        "mantananiIslandContent": MessageLookupByLibrary.simpleMessage(
            "Рядом с Кота-Белудом в Сабахе остров Мантанани предлагает одни из лучших мест для дайвинга на Борнео. Любители снорклинга и дайвинга приезжают, чтобы поплавать с морскими коньками и скатами на однодневных экскурсиях из столицы. Сертифицированные дайверы могут исследовать более 20 мест для погружений, включая три затонувших корабля. После нескольких часов на Южно-Китайском море отдохните и насладитесь знаменитым закатом Борнео на нетронутых белоснежных пляжах."),
