        "mossyForestContent": MessageLookupByLibrary.simpleMessage(
            "Мшистый лес — это природная экосистема, которая растет только на больших высотах в Камерон Хайлендс и других горных хребтах Малайзии. Низкие облака, перемещаемые ветром, окутывают деревья постоянным туманом и влагой, создавая идеальные условия для мхов, папоротников, лишайников и орхидей. Этот влажный тропический вечнозеленый лес также является убежищем для разнообразных горных видов, включая бабочек, грызунов, лягушек, птиц и млекопитающих, которые встречаются только в этом холодном климате."),
        "mountPulai":
            MessageLookupByLibrary.simpleMessage("Гора Пулаи, Джохор"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "Гора Пулаи высотой 654 метра расположена в Джохоре, на полуострове Малайзия. Благодаря близости и легкости доступа, это популярное место для походов среди сингапурцев и местных жителей. Вершина горы Пулаи закрыта для публики, так как охраняется военными и имеет две телекоммуникационные башни. Гора Пулаи — это умеренно загруженный маршрут длиной 14,3 километра недалеко от Кулая, Джохор, с водопадом и средней сложностью. Этот маршрут также используется для кемпинга, катания на велосипедах, бега и прогулок на природе."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
