            "Наси Лемак — это ароматный рис, традиционно приготовленный на кокосовом молоке и листьях пандана, подаваемый с острым самбалом, огурцами, жареными анчоусами, яйцом и жареными арахисами. Лучше всего сочетается с горячим стаканом те тарик. В большинстве магазинов или киосков можно добавить такие ингредиенты, как курица или говяжий ренданг, жареная курица, самбал с креветками и многое другое."),
