        "pangkorIsland": MessageLookupByLibrary.simpleMessage("Остров Пангкор"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "Посетите остров Пангкор, если вы ищете место без туристов. Расположенный недалеко от побережья Перак, остров предлагает пустынные пляжи, чистую воду и густые джунгли в центре. Посетители наслаждаются возможностью загорать под пальмами в одиночестве. Также посетите голландский колониальный форт и сделайте фотографии на традиционном деревянном причале."),
        "panoramaHill": MessageLookupByLibrary.simpleMessage(
            "Холм Панорама, Сунгай Лембинг"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "Холм Панорама — это холм в Сунгай Лембинг, в 45 километрах к северо-западу от Куантана. С высотой 271 метр, на него ведет только один путь. Начните подъем с нижней ступеньки и двигайтесь вверх. Основной особенностью маршрута является лестница с перилами; лишь небольшие участки не имеют лестницы. Достигнув вершины, вы сможете увидеть панорамный вид на окружающий город. Обычно подъем на холм Панорама занимает от 30 до 45 минут."),
        "parks": MessageLookupByLibrary.simpleMessage("Кафе"),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "Национальный парк Пенанг, Пенанг"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "Это самый маленький национальный парк Малайзии, площадью 23 квадратных километра, но его леса на побережье являются домом для серебристых листовых обезьян, летающих лемуров, леопардовых кошек и множества ящериц, амфибий и рептилий. Такие виды отдыха, как прогулки по джунглям и поездки на лодках к спокойным пляжам с золотым песком, могут занять весь день. В парке есть два основных маршрута для треккинга: один ведет вдоль побережья к Обезьяньему пляжу, а другой — через холмы и джунгли к более изолированным пляжам, где находится заповедник черепах."),
