            MessageLookupByLibrary.simpleMessage("Остров Пулау Лангкави"),
        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "Остров Лангкави является домом для некоторых из лучших пляжей полуострова Малайзия. Остров сочетает горы и мангровые леса с сверкающими берегами. Совершите однодневную поездку на остров Пулау Даян Бунтинг, который включен в список ЮНЕСКО, покормите орлов и посмотрите, как обезьяны плавают в поисках еды. Или возьмите полотенце и позагорайте на пляже Пантай Ченанг, прежде чем отправиться в бар на берегу. Еще одно преимущество этого острова - он безналоговый, так что не стесняйтесь предаться шопингу!"),
        "pulauRedang":
            MessageLookupByLibrary.simpleMessage("Остров Пулау Реданг"),
        "pulauRedangContent": MessageLookupByLibrary.simpleMessage(
            "Один из крупнейших островов на восточном побережье Малайзии, Пулау Реданг славится кристально чистыми водами и белыми песчаными пляжами. Это один из девяти островов, образующих морской заповедник, предлагающий туристам возможность для снорклинга и дайвинга. Пляж покрыт мягким белым песком. Вы можете увидеть кораллы и рыб буквально в нескольких метрах от берега."),
        "rapidKLBusDescription": MessageLookupByLibrary.simpleMessage(
            "Автобусы RapidKL часто можно увидеть на большинстве железнодорожных станций, и они обычно используются как транзитный транспорт для пассажиров, чтобы добраться до нужных мест. Каждая поездка может стоить до RM5.00, и оплата может быть произведена с помощью точной суммы или через карту Touch n’ Go при входе и выходе. Справочная служба: 03-7885 2585"),
