        "sevenWellsContent": MessageLookupByLibrary.simpleMessage(
            "Водопад Семи Колодцев, также известный как Джалан Телага Туджух, расположен примерно в 20 минутах ходьбы от знаменитого моста Лангкави Скай и является одной из самых впечатляющих природных достопримечательностей острова. Водопад ниспадает с горы Мат Чинчанг, второй по высоте вершины Лангкави, и пользуется популярностью среди туристов и местных жителей. Полная вертикальная высота водопада составляет 91 метр, но с нижнего уровня видна только небольшая часть. Согласно легенде, этот водопад является домом для фей, а вода обладает успокаивающими свойствами. Водопад выглядит волшебно, окруженный природой с богатой флорой и фауной."),
