            "Небольшой остров рядом с Семпорной в Сабахе считается одним из лучших мест для дайвинга в мире. На острове нет ни жилья, ни большого количества удобств. Рекомендуется взять тур во время вашей поездки. Перелет из Кота-Кинабалу в Семпорну и часовая поездка на лодке к черепахам и стаям барракуд того стоят. С момента получения охраняемого статуса в 2002 году, меньшее количество туристов может получить разрешение на посещение известнякового пика."),
