        "sungaiLembing":
            MessageLookupByLibrary.simpleMessage("Сунгай Лембинг, Паханг"),
        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "Малайзия богата тропическими лесами, в которых есть потрясающие водопады. Водопад Радуга находится в 45 километрах к северо-западу от Куантана, полуостров Малайзия, в городе Сунгай Лембинг. Каждое утро, между 9 и 10 часами, солнце освещает воду у подножия водопада, создавая удивительную радугу. Люди со всего мира приезжают сюда на полтора часа, чтобы увидеть красоту природы. Водопад Радуга — это большой водопад, скрытый в лесах Сунгай Лембинг, к нему можно добраться на внедорожнике и пешком."),
        "sungaiPisangContent": MessageLookupByLibrary.simpleMessage(
            "Водопад Писанг — это маршрут длиной 3,1 километра рядом с водопадом в Гомбаке, Селангор, Малайзия. Он подходит для туристов любого уровня подготовки. Тропа открыта круглый год и часто используется для кемпинга, катания на велосипедах и наблюдения за птицами. Ближе к вершине водопада есть отличные места для пикников и кемпинга. Это легкий поход, который требует перехода через водопад, так что приготовьтесь к мокрой обуви."),
